const displayMap = Object.values(display)

// Thanks @jared-hughes for the idea of using a map to store the display
// and then using the map to find the next permutation
const rep = (str, perm) => {
    return [...str]
        .map(char => perm[char.charCodeAt() - "a".charCodeAt()])
        .sort()
        .join('')
}

parsedLines.forEach(line => {
    const [signals, output] = line
    const allLine = [...signals, ...output]

    for(let perm of permutations) {
        if(allLine.every(v => displayMap.includes(rep(v, perm)))) {
            let r = output.map((v) => displayMap.indexOf(rep(v, perm)))
            digits.push(Number(r.join('')))
        }
    }
})

total = digits.reduce((acc, v) => acc + v, 0)

// Result
console.log('Part Two', total)
